import React, { Component } from 'react'

class AboutMeComponent extends Component {
    render() {
        return (
            <div>
                <p>
                Full-stack developer with excellent technical expertise ( HTML5, CSS3, JS - ES6 ) with the ability to analyze and solve problems. Write, analyze, review, and rewrite programs, using workflow chart and diagram, and applying knowledge of computer capabilities, subject matter, and symbolic logic. Adaptable and transformational managerial skills with an ability to work independently and collaboratively.
                </p>
            </div>
        )
    }
}
export default AboutMeComponent
